import React from 'react';

function YtScreen() {
  return (
    <div>
        <iframe width="560" height="315" src="https://www.youtube.com/embed/y0J1vmrMFDA?start=24" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
        </div>
  );
}

export default YtScreen;
